import './Expense.css'
import ExpenseItem from './ExpenseItem'
const Expense = (props) => {

    return (
        <div className="expenses">
            <ExpenseItem title={props.items[0].title} amount={title[0].amount} date={title[0].amount} />
            
        </div>
    )


}

export default Expense
